p.note:
Top left corner, in pencil: L-? Sec IX;
                                    top of page, in black ink: Kongl Bibl. 1734 års katalog. Theol in fol. n:o 28;
                                    centre page, in black ink: Hrabani Mauri Expositiones in Libros Regum.;
                                    centre page: National Library stamp;
                                    bottom left corner, in black ink: Sec. IX.

history.provenance:
It was acquired by  Queen Christina from  Paul Petau’s collection (See 
                                Meyier (1947)

                             ) and brought to Sweden, where it remained after her abdication. First mentioned in Vossius’s catalogue of 1649 (U 202:1). There are 3 signa on the : The older signum, No 28, is found in the catalogue of 1734 (U 125e) and e. 30.3.15 is found in Hammarsköld’s catalogue from the 19th century (U 133). A 137 is the current signum.
